{"1": "import java.util.*;
class LinkedList{
public Node head;
public Node tail;

public void insertFirst(int val){
    Node node=new Node(val);
    if(head==null){
        head=node;
        tail=node;
        return;
    }
    node.next=head;
    head=node;
}
public void sort(){
    for(Node i=head;i!=null;i=i.next){
        for(Node j=i;j!=null;j=j.next){
            if(i.val>j.val){
                int temp=i.val;
                i.val=j.val;
                j.val=temp;
            }
        }
    }
}
public void display(){
    Node node=head;
    while(node!=null){
        System.out.print(node.val+" ");
        node=node.next;
    }
}
class Node{
    public int val;
    public Node next;

    public Node(int val){
        this.val=val;
    }
}
}
public class Main{
    public static void main(String[] args){
        Scanner s=new Scanner(System.in);
        int n=s.nextInt();
        LinkedList ls=new LinkedList();
        for(int i=0;i<n;i++){
            if(!s.hasNextInt()){
                System.out.println("Invalid input");
                return;
            }
            ls.insertFirst(s.nextInt());
        }
        ls.sort();
        ls.display();
    }
}"}

