class str{
    static int stringl(String s){
        if(s.equals(""))
            return 0;
        return 1+stringl(s.substring(1));
    }
    public static void main(String[] args){
        Scanner sc = new Scanner(System.in);
        String s = sc.nextLine();
        int len=stringl(s);
        if(len>100){
            System.out.println("Invalid input");}
        else{
            System.out.println(len);
        }
        sc.close();
    }
            
}"}

